import React, { Component } from 'react';
import {Table} from 'react-bootstrap';
import axios from 'axios';
export default class AllDistricts extends Component {
    state={
        result:[],
        date:'',
    }
    componentDidMount(){
        axios.get('https://corona-bd.herokuapp.com/district').then(res => this.setState({result:res.data.data,date:res.data.updated_on})).catch(err => console.log('error to get dictrictwise data'));
    }
  render() {
    return (
      <div> <Table striped bordered hover size="sm">
      <thead>
        <tr>
          <th>#</th>
          <th>District</th>
          <th>Prev_count</th>
          <th>New Count</th>
          <th>New positive</th>
        </tr>
      </thead>
      <tbody>
        <tr>
          <td>1</td>
          <td>Mark</td>
          <td>Otto</td>
          <td>@mdo</td>
          <td>@mdo</td>
        </tr>
        
      </tbody>
    </Table> </div>
    );
  }
}
